import * as React from "react";
import { getFeaturedPosts } from "../../api/ghost";

function Semantics(props) {
  const initialData = props.posts;
  const { data: posts } = ("/api/getFeaturedPosts", getFeaturedPosts, {
    initialData
  });

  return (
    <div>
      <p>{posts}</p>
    </div>
  );
}

Semantics.getInitialProps = async () => {
  const posts = await getFeaturedPosts();
  return { posts: posts };
};

export default Semantics;
